    AppComponent.prototype.CompareTwo = function (itemA, itemB) {
        if (itemA.distance < itemB.distance)
            return -1;
        if (itemA.distance > itemB.distance)
            return 1;
        if (itemA.order < itemB.order)
            return -1;
        if (itemA.order > itemB.order)
            return 1;
        if (itemA.order == itemB.order) {
            var minA = Math.min(itemA.a, itemA.b);
            var minB = Math.min(itemB.a, itemB.b);
            if (itemA.p == 'b') {
                minA = itemA.b;
                minB = itemB.b;
            }
            else {
                minA = itemA.a;
                minB = itemB.a;
            }
            if (minA < minB)
                return -1;
            else
                return 1;
        }
    };
